import { Fragment } from "react";
import Header from './header.js'

const Form = ({ header, children, func }) => { return (
    <Fragment>
        <Header text={ header } />
        <div className={ 'content' }>
            <form onSubmit={ func }>

            </form>
            { children }
        </div>
    </Fragment>
)}

const Text = ({ label, value, func }) => { return (
    <div>
        <input
            value={ value }
            placeholder={ label }
            onChange={ func }
            type={ 'text' }
        />
    </div>
)}

const Number = ({ label, value, func }) => { return (
    <div>
        <input
            value={ value }
            placeholder={ label }
            onChange={ func }
            type={ 'number' }
        />
    </div>
)}

const Button = ({ label, func }) => { return (
    <div>
        <input
            value={ label }
            onClick={ func }
            type={ 'submit' }
            className={ 'submit' }
        />
    </div>
)}

export {
    Form,
    Text,
    Number,
    Button
}
